import React, { Component } from 'react'
import 'bootstrap/dist/css/bootstrap.min.css'

export default class Navi extends Component {
  render() {
    return (
      <div>
        <nav class="navbar navbar-static-top navbar-scroll" >
          <div class="container">
              <div class="navbar-header svd-page-scroller-arrow text-center">
                  <a class="navbar-brand navbar-toggle collapsed"  data-toggle="collapse" data-target="#navbar" aria-expanded="false" aria-controls="navbar">SIS</a>
              </div>
            </div>
        </nav>
      </div>
    )
  }
}
